q($,"aea","e5",function(){return C.bz.zx(0,'[{"hrvatski":"Stvari koje \u017eelim znati su u knjigama. Moj najbolji prijatelj je \u010dovjek koji mi daruje knjigu koju nisam pro\u010ditao.","deutsch":"Die Dinge die ich wissen m\xf6chte stehen in den B\xfcchern. Mein bester Freund ist ein Mensch, der mir ein Buch gibt, das ich nicht gelesen habe.","name":"Abraham Lincoln"},{"hrvatski":"Logika \u0107e vas odvesti od A do B. Ma\u0161ta \u0107e vas odvesti gdje god to po\u017eelite.","deutsch":"Die Logik wird Sie von A nach B bringen. Die Fantasie wird Sie bringen, wohin auch immer Sie wollen.","name":"Albert Einstein"},{"hrvatski":"\u017divot poznaje samo jednu istinsku zabrinutost: smrt.","deutsch":"Das Leben kennt nur eine wahre Sorge: den Tod.","name":"Alexandre Dumas"},{"hrvatski":"Ljudi uvijek govore da vrijeme mijenja stvari, ali zapravo ih morate sami promijeniti.","deutsch":"Die Leute sagen immer, dass die Zeit die Dinge ver\xe4ndert, aber in Wahrheit m\xfcssen Sie sie selber \xe4ndern.","name":"Andy Warhol"},{"hrvatski":"U svakom je \u010dovjeku pone\u0161to zatrtog Mozarta.","deutsch":"In jedem Menschen steckt etwas von Mozart.","name":"Antoine de Saint-Exup\xe9ry"},{"hrvatski":"Ljepota je otvoreno preporu\u010deno pismo koje za nas unaprijed pridobija srca.","deutsch":"Sch\xf6nheit ist ein offenes Empfehlungsschreiben, das uns im Voraus das Herz erobert.","name":"Arthur Schopenhauer"},{"hrvatski":"Moja samo\u0107a postala mi je udobna, bila je najsigurnije mjesto koje sam poznavao.","deutsch":"Meine Einsamkeit wurde mir angenehm, sie war der sicherste Ort den ich je gekannt hatte.","name":"Barack Obama"},{"hrvatski":"Mir nije odsutnost rata, nego vrlina koja izvire iz du\u0161evne snage.","deutsch":"Frieden ist nicht die Abwesenheit von Krieg, sondern eine Tugend, die aus geistiger St\xe4rke entspringt.","name":"Baruch Spinoza"},{"hrvatski":"Istinski znak inteligencije nije znanje nego ma\u0161ta.","deutsch":"Das wahre Zeichen der Intelligenz ist nicht Wissen, sondern Vorstellungskraft.","name":"Albert Einstein"},{"hrvatski":"Izgubljeno vrijeme nikad nije prona\u0111eno ponovno.","deutsch":"Verlorene Zeit wurde nie wieder gefunden.","name":"Benjamin Franklin"},{"hrvatski":"Kada se istina ne mo\u017ee obraniti, mora prije\u0107i u napad.","deutsch":"Wenn die Wahrheit nicht verteidigt werden kann, muss sie zum Angriff \xfcbergehen.","name":"Bertold Brecht"},{"hrvatski":"Biti predsjednik i biti upravitelj groblja vrlo je sli\u010dno. Ima\u0161 puno ljudi ispod sebe, a nitko te ne slu\u0161a.","deutsch":"Pr\xe4sident zu sein und Friedhofsmanager zu sein, ist sehr \xe4hnlich. Du hast viele Leute unter dir, aber niemand h\xf6rt dir zu.","name":"Bill Clinton"},{"hrvatski":"Sre\u0107a je \u010dudesna roba: \u0161to je vi\u0161e drugome daje\u0161, to je tebi vi\u0161e ostaje.","deutsch":"Gl\xfcck ist eine wunderbare Ware: Je mehr du einem anderen gibst, desto mehr bleibt dir.","name":"Blaise Pascal"},{"hrvatski":"Misli ispunjene sumnjom i strahom siguran su put do neuspjeha.","deutsch":"Gedanken voller Zweifel und Angst sind ein sicherer Weg zum Scheitern.","name":"Brian Adamas"},{"hrvatski":"Znanje se ne temelji isklju\u010divo na istinama nego i na pogre\u0161kama.","deutsch":"Wissen basiert nicht ausschlie\xdflich auf Wahrheiten, sondern auch auf Fehlern.","name":"Carl Gustav Jung"},{"hrvatski":"Tu\u017eno je starjeti, ali je lijepo sazrijevati.","deutsch":"Es ist traurig zu altern, aber es ist sch\xf6n zu reifen.","name":"Brigitte Bardot"},{"hrvatski":"Kada odlu\u010dite ne\u0161to u\u010diniti, u\u010dinite to odmah i bez oklijevanja.","deutsch":"Wenn Sie entscheiden etwas zu tun, tun Sie es sofort und ohne Z\xf6gern.","name":"Carlos Slim Helu"},{"hrvatski":"Ne pre\u017eivljavaju ni najja\u010di, ni najpametniji. Pre\u017eivljavaju oni koji se najbolje prilago\u0111avaju promjenama.","deutsch":"Weder die St\xe4rksten noch die Kl\xfcgsten \xfcberleben. Es \xfcberleben die, die sich am besten an Ver\xe4nderungen anpassen.","name":"Charles Darwin"},{"hrvatski":"Jer politi\u010dar nikada ne vjeruje u ono \u0161to govori, uvijek se iznenadi kada drugi vjeruju u to.","deutsch":"Weil ein Politiker nie glaubt an das was er sagt, ist er immer \xfcberrascht, wenn andere daran glauben.","name":"Charles de Gaulle"},{"hrvatski":"Tko putuje prema istini, putuje sam.","deutsch":"Wer zur Wahrheit reist, reist allein.","name":"Christian Morgenstern"},{"hrvatski":"Znam da je alkohol \u010dovjekov najve\u0107i neprijatelj. Ali Biblija ka\u017ee da moramo voljeti i neprijatelje.","deutsch":"Ich wei\xdf, dass Alkohol des Menschen gr\xf6\xdfter Feind ist. Aber die Bibel sagt, wir m\xfcssen auch unsere Feinde lieben.","name":"Frank Sinatra"},{"hrvatski":"Svi imaju dvojbe. Zato treba slu\u0161ati suradnike i tek onda odlu\u010diti.","deutsch":"Alle haben Zweifel. Deshalb mu\xdft du den Mitarbeitern zuh\xf6ren und erst dann entscheiden.","name":"Giorgio Armani"},{"hrvatski":"Tko \u017eeli biti dobar pobjednik, prije mora biti dobar gubitnik.","deutsch":"Wer w\xfcnscht ein guter Gewinner zu sei, muss vorher ein guter Verlierer sein.","name":"Halle Berry"},{"hrvatski":"Ili \u0107emo na\u0107i put ili \u0107emo ga napraviti.","deutsch":"Entweder finden wir den Weg oder wir schaffen ihn.","name":"Hannibal"},{"hrvatski":"Nije dovoljno samo \u017eivjeti. Moramo imati sunce, slobodu i lijepi cvijet.","deutsch":"Es ist nicht genug nur zu leben. Wir m\xfcssen Sonne, Freiheit und eine sch\xf6ne Blume haben.","name":"Hans Christian Andersen"},{"hrvatski":"U potpunom mraku svi smo isti, samo nas na\u0161e znanje i mudrost razlikuju. Zato, ne dopustite da vas o\u010di prevare.","deutsch":"In v\xf6lliger Dunkelheit sind wir alle gleich, nur unser Wissen und unsere Weisheit unterscheiden uns. Deshalb, lassen Sie nicht zu, dass Ihren Augen betr\xfcgen.","name":"Janet Jackson"},{"hrvatski":"Samo\u0107a je moj najve\u0107i strah. Pla\u0161im se dosa\u0111ivanja sa samim sobom.","deutsch":"Einsamkeit ist meine gr\xf6\xdfte Angst. Ich f\xfcrchte die Langeweile mit mir selbst.","name":"Jean Jacques Rousseau"},{"hrvatski":"Dobar je vic kao seks, najbolje skretanje pa\u017enje od realnosti.","deutsch":"Ein guter Witz ist wie Sex, die beste Ablenkung der Aufmerksamkeit von der Realit\xe4t.","name":"Jerry Seinfeld"},{"hrvatski":"Ne mo\u017ee\u0161 birati kako \u0107e\u0161 i kada umrijeti. Mo\u017ee\u0161 samo odlu\u010diti kako \u0107e\u0161 \u017eivjeti.","deutsch":"Du kannst nicht w\xe4hlen, wie und wann Du stirbst. Du kannst nur entscheiden, wie du leben wirst.","name":"Joan Baez"},{"hrvatski":"Splesti vijenac mnogo je lak\u0161e nego za njega na\u0107i dostojnu glavu.","deutsch":"Einen Kranz zu flechten ist viel einfacher als einen w\xfcrdigen Kopf f\xfcr ihn zu finden.","name":"Johann Wolfgang von Goethe"},{"hrvatski":"Samo pametan \u010dovjek mo\u017ee shvatiti da je napravio glupost.","deutsch":"Nur ein kluger Mann kann erkennen, dass er Unsinn gemacht hat.","name":"John Fitzgerald Kennedy"},{"hrvatski":"Mo\u017ee\u0161 zatvoriti o\u010di nad stvarima koje ne \u017eeli\u0161 gledati, ali ne mo\u017ee\u0161 srcu re\u0107i da prestane osje\u0107ati.","deutsch":"Du kannst die Augen schlie\xdfen vor Dingen die Du nicht sehen m\xf6chtest, aber Du kannst dem Herzen nicht sagen, dass es aufh\xf6ren soll zu f\xfchlen.","name":"Johnny Depp"},{"hrvatski":"Dvoje ljudi stvara ljubav, razli\u010ditim na\u010dinima samo\u0107e.","deutsch":"Zwei Menschen erschaffen Liebe auf unterschiedliche Weise der Einsamkeit.","name":"Jose Pierre Louis Aragon"},{"hrvatski":"Ru\u017ean je \u017eivot jo\u0161 uvijek bolji od lijepog sprovoda.","deutsch":"Ein h\xe4ssliches Leben ist immer noch besser als eine sch\xf6ne Beerdigung.","name":"Katharine Hepburn"},{"hrvatski":"Svi mi dodu\u0161e \u017eivimo pod istim nebom, ali nemamo svi isti horizont.","deutsch":"Wir leben zwar alle unter demselben Himmel, aber wir haben nicht alle denselben Horizont.","name":"Konrad Adenauer"},{"hrvatski":"Patnje su na\u0161i najbolji u\u010ditelji. \u010covjek kroz suze vidi dalje nego teleskopom. \u017dalost bi morala biti u\u010diteljica mudrosti.","deutsch":"Leiden sind unsere besten Lehrer. Ein Mann sieht durch Tr\xe4nen weiter als ein Teleskop. Trauer sollte ein Lehrer der Weisheit sein.","name":"Lord Byron"},{"hrvatski":"Kada ljudi ne bi radili glupe stvari, ni\u0161ta se inteligentno nikada nebi ni dogodilo.","deutsch":"Wenn die Leute keine dummen Dinge tun w\xfcrden, w\xfcrde niemals etwas Intelligentes passieren.","name":"Ludwig Wittgenstein"},{"hrvatski":"Siroma\u0161an je \u010dovjek \u010dija sre\u0107a ovisi o tu\u0111em dopu\u0161tenju.","deutsch":"Armselig ist ein Mensch, dessen Gl\xfcck abh\xe4ngt von einer fremden Erlaubnis.","name":"Madonna"},{"hrvatski":"\u017divot bez na\u010dela je brod bez kormila.","deutsch":"Ein Leben ohne Prinzipien ist ein Schiff ohne Ruder.","name":"Mahatma Gandhi"},{"hrvatski":"\u017dene uzorna pona\u0161anja nikada ne u\u0111u u povijest.","deutsch":"Frauen mit vorbildlichem Verhalten gehen nie in die Geschichte ein.","name":"Maria Shriver"},{"hrvatski":"Najljep\u0161a stvar za mene je spavanje, jer onda barem mogu sanjati.","deutsch":"Die sch\xf6nste Sache f\xfcr mich ist das Schlafen, denn dann kann ich wenigstens tr\xe4umen.","name":"Marilyn Monroe"},{"hrvatski":"Prava du\u017enost prijatelja je da stane uz vas kad ste u krivu. Gotovo svatko mo\u017ee stati uz vas kad ste u pravu.","deutsch":"Die wahre Pflicht eines Freundes ist es, Ihnen zur Seite zu stehen wenn sie im Unrecht sind. Fast jeder kann zu Ihnen stehen, wenn Sie im Recht sind.","name":"Mark Twain"},{"hrvatski":"Zapamtite ovo \u2013 vrlo je malo potrebno za sretan \u017eivot.","deutsch":"Merken sie sich dieses - sehr wenig ist n\xf6tig f\xfcr ein gl\xfcckliches Leben.","name":"Marcus Aurelius"},{"hrvatski":"Ne mo\u017eemo promijeniti budu\u0107nost, ali mo\u017eemo promijeniti navike koje \u0107e promijeniti budu\u0107nost.","deutsch":"Wir k\xf6nnen die Zukunft nicht \xe4ndern, aber wir k\xf6nnen Gewohnheiten \xe4ndern, die die Zukunft ver\xe4ndern werden.","name":"Marco Polo"},{"hrvatski":"Ne reci uvijek \u0161ta zna\u0161, ali znaj uvijek \u0161ta ka\u017ee\u0161.","deutsch":"Sage nicht immer was du wei\xdft, aber wisse immer was du sagst.","name":"Matthias Claudius"},{"hrvatski":"Bog ne pla\u0107a dugove u novcu.","deutsch":"Gott zahlt Schulden nicht in Geld.","name":"Muhammed al Fayed"},{"hrvatski":"Trpiti zahtijeva vi\u0161e hrabrosti nego umrijeti.","deutsch":"Leiden erfordert mehr Mut als Sterben.","name":"Napoleon Bonaparte"},{"hrvatski":"Ovo je mali korak za \u010dovjeka, a veliki skok za \u010dovje\u010danstvo.","deutsch":"Dies ist ein kleiner Schritt f\xfcr einen Menschen, aber ein riesiger Sprung f\xfcr die Menschheit.","name":"Neil Armstrong"},{"hrvatski":"U svemiru postoji samo jedan hram, a to je ljudsko tijelo.","deutsch":"Im Universum existiert nur ein Tempel, und das ist der menschliche K\xf6rper.","name":"Novalis"},{"hrvatski":"Nakon dobre ve\u010dere, mo\u017ee se oprostiti svima. \u010cak i vlastitim ro\u0111acima.","deutsch":"Nach einem guten Abendessen kann jedem vergeben werden. Sogar den eigenen Verwandten.","name":"Oscar Wilde"},{"hrvatski":"Zakoni su poput kobasica. Bolje je da ne vidite kako se prave.","deutsch":"Gesetze sind wie W\xfcrste. Es ist besser, dass Sie nicht sehen, wie sie gemacht werden.","name":"Otto von Bismarck"},{"hrvatski":"Tko ho\u0107e ne\u0161to u\u010diniti na\u0111e na\u010din. Tko ne\u0107e, na\u0111e opravdanje.","deutsch":"Wer etwas tun will, findet einen Weg. Wer nicht will, findet eine Entschuldigung.","name":"Pablo Picasso"},{"hrvatski":"Sve bitke u \u017eivotu slu\u017ee da nas ne\u010demu nau\u010de \u2013 uklju\u010duju\u0107i i one koje gubimo. Kad poraste\u0161, otkrit \u0107e\u0161 da si \u010desto branio la\u017e, obmanjivao sebe ili patio zbog gluposti.","deutsch":"Alle Schlachten im Leben dienen dazu, uns etwas beizubringen - einschlie\xdflich auch derer, die wir verlieren. Wenn du w\xe4chst, wirst du entdecken, dass du oft eine L\xfcge verteidigt hast, dich selbst get\xe4uscht oder wegen Dummheit gelitten hast.","name":"Paulo Coelho"},{"hrvatski":"\u017dalim pro\u0161lost, nadam se budu\u0107nosti i sam nezadovoljan sa sada\u0161njo\u0161\u0107u \u2013 to je moj \u017eivot.","deutsch":"Ich bedaure die Vergangenheit, ich hoffe auf die Zukunft und bin unzufrieden mit der Gegenwart - das ist mein Leben.","name":"Pjotr Iljitsch Tschaikowski"},{"hrvatski":"Radost nije u stvarima, ona je u nama.","deutsch":"Freude ist nicht in Dingen, sie ist in uns.","name":"Richard Wagner"},{"hrvatski":"Lo\u0161e planiranje, to je druga rije\u010d za pustolovinu.","deutsch":"Schlechte Planung, das ist ein anderes Wort f\xfcr Abenteuer.","name":"Roald Engelbregt Gravning Amundsen"},{"hrvatski":"Strah nastaje kad se suo\u010dite s izazovom.","deutsch":"Angst entsteht, wenn Sie sich mit einer Herausforderung konfrontieren.","name":"Robert De Niro"},{"hrvatski":"Najbolje ideje dolaze u najgorim vremenima.","deutsch":"Die besten Ideen kommen in den schlechtesten Zeiten.","name":"Robin Williams"},{"hrvatski":"Nije va\u017eno koliko jako mo\u017ee\u0161 udariti, va\u017eno je koliko jaki udarac mo\u017ee\u0161 primiti i nastavi\u0161.","deutsch":"Es ist nicht wichtig, wie hart du schlagen kannst, wichtig ist, wie hart du einen Schlag hinnehmen kannst und weitermachst.","name":"Rocky Balboa"},{"hrvatski":"Novac je apsolutno neva\u017ean, osim u slu\u010daju kad ga nema\u0161.","deutsch":"Geld ist absolut unwichtig, au\xdfer im Fall du hast es nicht.","name":"Ron Dennis"},{"hrvatski":"Ne mo\u017eemo pomo\u0107i svima, ali svatko mo\u017ee pomo\u0107i nekome.","deutsch":"Wir k\xf6nnen nicht jedem helfen, aber jeder kann jemandem helfen.","name":"Ronald Reagan"},{"hrvatski":"U\u017eitak je najsla\u0111i lijek.","deutsch":"Vergn\xfcgen ist die s\xfc\xdfeste Medizin.","name":"Salman Rushdie"},{"hrvatski":"Rije\u010d izgovorena u pravo vrijeme zlatna je jabuka u srebrnoj \u010da\u0161i.","deutsch":"Das Wort, das zur richtigen Zeit gesprochen wird, ist ein goldener Apfel in einer silbernen Tasse.","name":"Solomon"},{"hrvatski":"Zapamtite da se \u010ditav va\u0161 \u017eivot odvija upravo ovoga trenutka.","deutsch":"Denken Sie daran, dass Ihr ganzes Leben gerade in diesem Moment stattfindet.","name":"Sharon Stone"},{"hrvatski":"\u010covjek je moralniji nego \u0161to misli i nemoralniji nego \u0161to to mo\u017ee zamisliti","deutsch":"Der Mensch ist moralischer als er denkt und unmoralischer als er sich vorstellen kann.","name":"Sigmund Freud"},{"hrvatski":"\u010cak i \u0161tetna istina vi\u0161e vrijedi od korisne la\u017ei.","deutsch":"Selbst eine sch\xe4dliche Wahrheit taugt mehr als eine n\xfctzliche L\xfcge.","name":"Thomas Mann"},{"hrvatski":"Mudrost samo jednog \u010dovjeka je poput drveta bez korijena.","deutsch":"Die Weisheit nur eines Menschen ist wie ein Baum ohne Wurzeln.","name":"Tsunetamo Yamamoto"},{"hrvatski":"Umjetnik je ruka koja ljudsku du\u0161u, posredstvom ove ili one tipke, svrhovito dovodi u vibraciju.","deutsch":"Ein K\xfcnstler ist eine Hand, die die menschliche Seele mit Hilfe dieser oder jener Taste gezielt in Schwingung versetzt.","name":"Vasilij Kandinsky"},{"hrvatski":"Ni\u0161ta nije mo\u010dnije od ideje \u010dije je vrijeme stiglo.","deutsch":"Nichts ist m\xe4chtiger als eine Idee, deren Zeit gekommen ist.","name":"Victor Hugo"},{"hrvatski":"Klanjati se velikom ljudima i zanositi se njihovim idealima nije sramota. Sramota je nemati ideala i puzati pred tiranima.","deutsch":"Gro\xdfe Menschen anzubeten und sich von ihren Idealen mitrei\xdfen zu lassen ist keine Schande. Es ist eine Schande, keine Ideale zu haben und vor Tyrannen zu kriechen.","name":"Viktor Car Emin"},{"hrvatski":"Na\u010din kako ne\u0161to po\u010deti je prestati pri\u010dati o tome i krenuti djelovati.","deutsch":"Der Weg, etwas zu beginnen, ist aufzuh\xf6ren dar\xfcber zu reden und zu beginnen zu handeln.","name":"Walt Disney"},{"hrvatski":"Navike ne primje\u0107ujete toliko dugo sve dok ih se ne poku\u0161ate rije\u0161iti.","deutsch":"Sie bemerken Gewohnheiten erst, wenn Sie versuchen, sie loszuwerden.","name":"Warren Buffett"}]',null)})
